import React from "react";
import { Fulltime } from "../request/Request";
import jobliststyle from "./joblist.css";
class Joblist extends React.Component{
constructor({firstname,state,address,lastname,pnumber,jobtype,email,middlename}){
  super({firstname,state,address,lastname,pnumber,jobtype,email,middlename})

}

    render(){
      return(
        <div id="joblistdiv" style={jobliststyle}>
          <div id="cardheader" style={{width:"100%", color:"green"}}> 
          <h2 style={{textAlign:"left"}}>State: {this.state}</h2>
          <button id="job-apply-btn"style={{width:"100%",margin:"0"}}>Apply</button>
          </div>

          <div>
            <table>
              <tr>
                <td>Address:</td>
                <td>{this.address}</td>

              </tr>
              <tr>
              <td>FullName:</td>
                <td>{this.firstname +"  "+ " "+this.lastname+" "+" "+ this.middlename}</td>
              </tr>
              <tr>
                <td>Email</td>
                <td>{this.email}</td>
              </tr>
              <tr>
                <td>Jobtype</td>
                <td>{this.jobtype}</td>
              </tr>
            </table>
          </div>


        </div>
      )
    }







}

export default Joblist;
